import React, {Component} from 'react';
import './App.css'
import Navbar from './Navbar.js'

class App extends Component {

	constructor(props){
		super(props)
		this.state = {
			account: '0x0'
		}
	}

	//react code goes here
	render(){
		return (
			<div>
				<Navbar account={this.state.account}/>

					<div>
						<h>
							'Hello World'
						</h>
					</div>
			</div>
		)
	}
}

export default App;
